//LetterManagementRetrieveUserInfo for Letter Management
const CallServerSide = function () {

    VV.Form.ShowLoadingPanel();
    //This gets all of the form fields.
    let formData = VV.Form.getFormDataCollection();

    let FormInfo = {};
    FormInfo.name = 'REVISIONID';
    FormInfo.value = VV.Form.DataID;
    formData.push(FormInfo);

    let UserInfo = {};
    UserInfo.name = 'USERID';
    UserInfo.value = VV.Form.FormUsID;
    formData.push(UserInfo);

    //Following will prepare the collection and send with call to server side script.
    const data = JSON.stringify(formData);
    const requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=LetterManagementRetrieveUserInfo',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

VV.Form.ShowLoadingPanel();

$.when(
    CallServerSide()
).always(function (resp) {
    //console.log(resp);
    if ('' == VV.Form.GetFieldValue('Letter HTML')) {
        VV.Form.SetFieldValue('Letter HTML', VV.Form.GetFieldValue('Default Template Content'), false)
        VV.Form.SetFieldValue('Subject of Template', 'General Notification');
    }

    VV.Form.HideLoadingPanel();
    let messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {
                /*
                Legend:
                resp.data[1] = Array List of "State Staff", "Job Leadership" and "Individual Info" objects
                */

                //The tokens are already set using a template function that runs through the Array of objects that arrives from the Web service
                const tokens = VV.Form.Template.PopulateDataTokens(resp.data[1]);
                VV.Form.SetFieldValue('Formatted Data Tokens', tokens);

                //If the response contains an Email Recipient, set it in the corresponding field
                if (resp.data[1][3].value!="") {
                    VV.Form.SetFieldValue('Recipient Email',  resp.data[1][3]["value"]);
                }

                //The tokens are set in this field in string format to be able to merge with the tokens of the letter
                VV.Form.SetFieldValue('Data Tokens', JSON.stringify(resp.data[1]));
            }
            else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered. ' + resp.data[1];
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                alert(messageData);
            }
            else {
                messageData = 'An unhandled response occurred when calling LetterManagementRetrieveUserInfo. The form will not save at this time.  Please try again or communicate this issue to support.';
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                alert(messageData);
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.HideLoadingPanel();
            //VV.Form.Global.DisplayMessaging(messageData);
            alert(messageData);
        }
    }
    else {
        messageData = "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>';
        VV.Form.HideLoadingPanel();
        //VV.Form.Global.DisplayMessaging(messageData);
        alert(messageData);
    }
});

// DynamicTokenMerge for Letter Management - Does a search and replace on the tokens in the Letter HTML field for values on the LANCE Data tab.
const tokenStr = VV.Form.GetFieldValue('Manual Tokens');
let tokens = tokenStr.match(/{.+?}/g);
let tokenValArr = [];
let emptyTokens = "";

for (let i = 0; i < tokens.length; i++) {
    let tokenVal = $(`#token${i + 1}`).val();
    console.log(tokenVal)
    tokenValArr.push(tokenVal);
}

const MergeTokens = function () {
    console.log('starting merge')
    let newLetterHTML = VV.Form.GetFieldValue('Letter HTML');

    for (let i = 0; i < tokens.length; i++) {
        if (emptyTokens === '' && tokenValArr[i].trim() === '')
            emptyTokens += "<p>The following tokens were not replaced as they have no value:</p>";

        if ('' !== tokenValArr[i].trim())  // If the token is blank, the change is not made.
            newLetterHTML = newLetterHTML.replace(new RegExp(tokens[i], 'gi'), tokenValArr[i]);
        else
            emptyTokens += "<p><b>" + tokens[i] + "</b></p>";

    }
    VV.Form.SetFieldValue('Letter HTML', newLetterHTML, false);

    if (emptyTokens !== '') {
        emptyTokens += "<p>If the tokens were added without value on purpose, you need to remove the token manually in the card field.</p>";
        VV.Form.Global.DisplayMessaging(emptyTokens, "Set Dynamic Values");
    }
}

MergeTokens();
VV.Form.Template.MergeCancelModal();

// MergeDataTokens for Letter Management - Does a search and replace on the tokens in the Letter HTML field for values on the Data Tokens tab.
const SignatureTokens = ['cmo signature', 'deputy director signature'];
const SignatureWidth = '200px';
let tokensNotFound = { notExist: [], noValue: [] };

// gets the JSON data from the Data Tokens tab and returns a new object with lowercase keys
const ParseDataTokens = function () {
	const DataTokensText = VV.Form.GetFieldValue('Data Tokens');
	const DataTokensJSON = JSON.parse(DataTokensText);
	let DataTokens = {};

	for (let i = 0; i < DataTokensJSON.length; i++) {
		DataTokens[i] = DataTokensJSON[i].value;
	}

	let DataTokensNormalized = {};
	for (let ldjKey in DataTokens) {
		let lowerCaseProps = {};
		if (DataTokens.hasOwnProperty(ldjKey)) {
			for (let itemKey in DataTokens[ldjKey]) {
				if (DataTokens[ldjKey].hasOwnProperty(itemKey)) {
					// make all of the keys lowercase to facilitate parsing
					lowerCaseProps[itemKey.toLowerCase()] = DataTokens[ldjKey][itemKey];
				}
			}
		}
		DataTokensNormalized[ldjKey] = lowerCaseProps;
	}
	return DataTokensNormalized;
};

const ShowTokenNotFoundModal = function () {
	let modalTitle = 'Tokens could not be replaced';
	let modalBody = '<p>Unable to replace all tokens in the body of the letter because the corresponding information was not found in this context. Please make sure the name of the token matches an item from the list of tokens found in the Data Tokens tab.</p>';
	if (tokensNotFound.notExist.length > 0) {
		modalBody += '<p>The following Tokens were not found:</p>'
		for (let line in tokensNotFound.notExist) {
			modalBody += '<ul style="margin-bottom: 2px;"><strong>[' + tokensNotFound.notExist[line] + ']</strong></ul>\n';
			modalBody += '\n';
		}
		modalBody += '<br>';
	}
	if (tokensNotFound.noValue.length > 0) {
		modalBody += '<p>The following tokens do not have a value that can replace an existing token:</p>'
		for (let line in tokensNotFound.noValue) {
			modalBody += '<ul style="margin-bottom: 2px;"><strong>[' + tokensNotFound.noValue[line] + ']</strong></ul>\n';
		}
	}
	const showCloseButton = true;
	const closeButtonText = 'Ok';
	const showOkButton = false;
	const okButtonText = null;
	const okButtonCallback = null;
	VV.Form.Global.MessageModal(false, modalTitle, modalBody, showCloseButton, showOkButton, okButtonText, okButtonCallback, closeButtonText);
};

// search and replace tokens on the Letter HTML
const SearchAndReplaceTokens = function () {
	const DataTokens = ParseDataTokens(); // gets data from data tab
	if (!DataTokens || DataTokens.length < 1) {
		return
	}

	const tokenRegex = new RegExp('\\[[^\\]]+\\]', 'g');
	//const tokenRegexBr = new RegExp('\\[[^\\]]+\\]<br>', 'g');
	let newLetterHTML = VV.Form.GetFieldValue('Letter HTML');

	let m;
	let tokens = [];

	while ((m = tokenRegex.exec(newLetterHTML)) !== null) {
		// This is necessary to avoid infinite loops with zero-width matches
		if (m.index === tokenRegex.lastIndex) {
			tokenRegex.lastIndex++;
		}

		// The result can be accessed through the `m`-variable.
		m.forEach((match) => {
			let foundToken = false;

			let key = match.substring(1, match.length - 1);
			let tokenName = key.toLowerCase();

			for (let ldk in DataTokens) {
				if (DataTokens[ldk][tokenName] !== undefined) {
					tokens.push({
						"regex": '\\[' + key + '\\]',
						"value": DataTokens[ldk][tokenName]
					});
					foundToken = true;
					break;
				}
			}
			if (!foundToken) {
				tokensNotFound.notExist.push(tokenName);
			}
		});
	}

	for (let token of tokens) {
		if (token.value != "") {
			newLetterHTML = newLetterHTML.replace(new RegExp(token.regex, 'g'), token.value);
		} else {
			if (typeof token === 'object') {
				tokensNotFound.noValue.push(token.regex.substring(2, token.regex.length - 2));
			} else {
				tokensNotFound.noValue.push(token);
			}

		}
	}

	VV.Form.SetFieldValue('Letter HTML', newLetterHTML, false);

	if (tokensNotFound.noValue.length > 0 || tokensNotFound.notExist.length > 0) {
		let messageModal = $('#ModalOuterDiv');
		// if message modal is not hidden, it is in the process of hiding; show after hidden
		if (messageModal.css('display') == 'none') {
			ShowTokenNotFoundModal();
		} else {
			messageModal.one('hidden.bs.modal', function () {
				ShowTokenNotFoundModal();
			});
		}
	}
};

