//LetterManagementSendEmail for Letter Management
const CallServerSide = function () {

    VV.Form.ShowLoadingPanel();
    //This gets all of the form fields.
    const formData = VV.Form.getFormDataCollection();

    let FormInfo = {};
    FormInfo.name = 'REVISIONID';
    FormInfo.value = VV.Form.DataID;
    formData.push(FormInfo);

    let UserInfo = {};
    UserInfo.name = 'USERID';
    UserInfo.value = VV.Form.FormUsID;
    formData.push(UserInfo);

    let URLInfo = {};
    URLInfo.name = 'baseURL';
    URLInfo.value = VV.BaseURL;
    formData.push(URLInfo);

    //Following will prepare the collection and send with call to server side script.
    const data = JSON.stringify(formData);
    const requestObject = $.ajax({
        type: "POST",
        url: VV.BaseAppUrl + 'api/v1/' + VV.CustomerAlias + '/' + VV.CustomerDatabaseAlias + '/scripts?name=LetterManagementSendEmail',
        contentType: "application/json; charset=utf-8",
        data: data,
        success: '',
        error: ''
    });

    return requestObject;
};

VV.Form.ShowLoadingPanel();

$.when(
    CallServerSide()
).always(function (resp) {
    console.log(resp);
    VV.Form.HideLoadingPanel();
    let messageData = '';
    if (typeof (resp.status) != 'undefined') {
        messageData = "A status code of " + resp.status + " returned from the server.  There is a communication problem with the  web servers.  If this continues, please contact the administrator and communicate to them this message and where it occurred.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (typeof (resp.statusCode) != 'undefined') {
        messageData = "A status code of " + resp.statusCode + " with a message of '" + resp.errorMessages[0].message + "' returned from the server.  This may mean that the servers to run the business logic are not available.";
        VV.Form.Global.DisplayMessaging(messageData);
    }
    else if (resp.meta.status == '200') {
        if (resp.data[0] != 'undefined') {
            if (resp.data[0] == 'Success') {

                const formURL = VV.BaseAppUrl + "FormViewer/app?DataID=" + resp.data[2] + "&hidemenu=true&xcid=bbf860ac-4f45-eb11-81f5-912ea5398475&xcdid=419017bf-4f45-eb11-81f5-912ea5398475"

                console.log(formURL);

                window.open(formURL)
            }
            else if (resp.data[0] == 'Error') {
                messageData = 'An error was encountered. ' + resp.data[1];
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                alert(messageData);
            }
            else {
                messageData = 'An unhandled response occurred when calling LetterManagementSendEmail. The form will not save at this time.  Please try again or communicate this issue to support.';
                VV.Form.HideLoadingPanel();
                //VV.Form.Global.DisplayMessaging(messageData);
                alert(messageData);
            }
        }
        else {
            messageData = 'The status of the response returned as undefined.';
            VV.Form.HideLoadingPanel();
            //VV.Form.Global.DisplayMessaging(messageData);
            alert(messageData);
        }
    }
    else {
        messageData = "The following unhandled response occurred while attempting to retrieve data on the the server side get data logic." + resp.data.error + '<br>';
        VV.Form.HideLoadingPanel();
        //VV.Form.Global.DisplayMessaging(messageData);
        alert(messageData);
    }
});

//VV.Form.Template.ManualMerge()
//Functionality:  Take the values of the "Manual Tokens" field, create the input fields and display the modal.
//Parameters:

const tokenStr = VV.Form.GetFieldValue('Manual Tokens');
const tokens = tokenStr.match(/{.+?}/g);
let mergeMessageArea = '<p class="mergeUserMessage">For each item in the list below, enter the value that should be present in the generated letter. An empty entry will replace the token with an empty value leaving it blank.</p > ';

// Populate modal
$(mergeMessageArea).appendTo('#mergeMessageArea');

//For each token, it will insert an input text. The value of the ID will be the name of the token.
for (let i = 0; i < tokens.length; i++) {
    let tokenText = tokens[i].match(/{([^}]+)}/)[1];

    $(`<p id="${tokenText}" style="margin-bottom: 18px;"><label for="fname">${tokenText}: </label>
                    <input type="text" id="token${i + 1}" name="fname" style="float:right;clear:both"></p>`
    ).appendTo('#mergeButtonArea');
}

// Display modal. The modal itself has buttons to submit or cancel.
$('#mergeModal').modal({ backdrop: 'static', keyboard: false });

