//Helper function to determine if any passed in controlValue is null
function isNull(controlValue) {
    if (controlValue == '' || controlValue == null || controlValue == undefined || controlValue == 'Select Item') {
        return true;
    }
    return false;
}

//Helper function to determine if any passed in controlValue is null
function isNull(controlValue) {
    if (controlValue == '' || controlValue == null || controlValue == undefined || controlValue == 'Select Item') {
        return true;
    }
    return false;
}

